import React from "react";

const Picture = ({ data }) => {
  return (
    <div className="picture">
      <p>Author：{data.photographer}</p>
      <div className="imageContainer" onClick={data.src.large}>
        <img src={data.src.large} alt="" />
      </div>
      <p>
        {/*新增頁面*/}
        <a>檢視圖片</a>
      </p>
    </div>
  );
};

export default Picture;
